import { Box } from '@mui/material';
import React from 'react';
import CombinedSelectors from './components/selectBoxservices';

function Bookservices() {
  return (
    <Box
      sx={{
        minHeight: '100vh',
        backgroundColor: 'white',
        backgroundSize: 'cover',
        padding: '15px 30px',
        backgroundRepeat: 'no-repeat',
      }}
    >
      <Box
        sx={{
          marginBottom: '20px',
          backgroundColor: 'red',
          color: 'white',
          padding: '1px',
          borderRadius: '8px',
        }}
      >
        <div style={{ textAlign: 'center', marginTop: '20px' }}>
          <h1>E-Just services</h1>
        </div>
      </Box>
      
      {/* Render CombinedSelectors */}
      <CombinedSelectors />
    </Box>
  );
}

export default Bookservices;
